import React from 'react';
import Navbar from '../Navbar/Navbar';
import Main from '../Main/Main';

const landing = ( props ) => {
    return (
        <div className='container'>
            <Navbar></Navbar>
            <div className='main_div'>
               <Main></Main>
            </div>
        </div>
    );
};

export default landing;
